import React from "react";
import Breathe from "../Breathe";

const Exercise = () => {
    return(
        <div> 
            <section id="exercise">
                <div className="container my-5 py-5">
                    <div className="row">
                        <div className="col-md-6">
                            <img src="/assets/aboutImg.png" alt="About" className = "w-75 mt-5"/>
                        </div>
                        <div className="col-md-6">
                            <h3 className="fs-5 mb-0">About Us</h3>
                            <h1 className="display-6 mb-2">Who <b> We </b> Are </h1>
                            <hr className = "w-50"/>
                            <Breathe />
                            <button className="btn btn-dark rounded-pill px-4 py-2">Get Started</button>
                            <button className="btn btn-outline-dark rounded-pill px-4 py-2 ms-2">Contact Us</button>
                        </div>
                    </div>
                </div>
            </section>
        </div>
        );
    }
    
    export default Exercise;
